import styled from 'styled-components'
import Image from 'next/image';

const StyledImg = styled(Image)``;

export const ProductImg = ({ src, hovered }) => {
    return (
       <StyledWrap hovered={hovered}>
          <StyledImg src={src} width={300} height={300} />
       </StyledWrap>
    );
 };
